using Newtonsoft.Json;
using PsstsClient.Entity;
using PsstsClient.Service;
using PsstsClient.Utility;
using System;
using System.Collections;

namespace SantaiSocket.Service
{
    public class demoService : BaseBusinessService
    {
        public string SendRequest()
        {
            string recData = string.Empty;

            try
            {
                IdWorker idWorker = new IdWorker(1);
                BusinessDataEntity businessData = new BusinessDataEntity();

                businessData.requestId = idWorker.nextId().ToString();
                businessData.businessType = "demoService";
                businessData.businessMethod = "test1";

                string body = "";

                Hashtable queryParam = new Hashtable();
                queryParam.Add("consNo", body);

                businessData.AddJsonData(queryParam);
                string sendJson = JsonConvert.SerializeObject(businessData);

                base.SendData(sendJson);

                /*byte[] jiemiData = base.GetRecData();

                jiemiData = GZipUtil.Decompress(jiemiData);

                recData = System.Text.Encoding.UTF8.GetString(jiemiData);*/

                recData = base.GetRecString();
            }
            catch (Exception ex)
            {
                throw ex;
            }
            return recData;
        }
    }
}
